import React, { Component } from 'react';
import './App.css';
import TodoItem from './components/TodoItems';
class App extends Component {
  constructor() {
    super();
    this.todoItems = [
        'Job 1',
        'Job 2',
        'Job 3'
    ];
  }

  render() {
    return (
      <div className="App"> 
        <TodoItem title="Job 1"/>
        <TodoItem title="Job 1"/>
        <TodoItem title="Job 1"/>
      </div>
    );
  }

}

export default App;
